        color: black;

      }

        fill: none;

    <script type="text/javascript">
      function draw(data) {
      
      /*
        D3.js setup code
      */

          "use strict";
          var margin = 75,
			width = 1400 - margin,
            height = 600 - margin;

          var radius = 3;
          var color = "blue";
			d3.select("body")
			  .append("h2")
              .text("Baseball Player Home Runs relative to Body Mass Index")

          var svg = d3.select("body")
            .append("svg")
              .attr("width", width + margin)
              .attr("height", height + margin)
            .append('g')
                .attr('class','chart');

      /*
        Dimple.js Chart construction code
      */

          d3.select("svg")
            .selectAll("circle")
            .data(data)
            .enter()
            .append("circle");
			
		  svg.append("text")             // text label for the x axis
			.attr("x", (width / 2) )
			.attr("y",  height+30)
			.attr("dy", ".71em")
			.style("text-anchor", "middle")
			.style("font-size", "16px")
			.text("Body Mass Index");
			
		  svg.append("text")             // text label for the y axis
			.attr("x", (15) )
			.attr("y", (height/2))
			.attr("dy", ".71em")
			.style("text-anchor", "middle")
			.style("font-size", "16px")
			.text("HR");

          // Find range of BMI column & change time_extent variable to x_extent
          var x_extent = d3.extent(data, function(d) {
              return d['BMI'];
          });

          // Find range of HR column -- converted to bb
          var count_extent = d3.extent(data, function(d) {
              return d['HR'];
          })

          // Create x-axis scale mapping BMI -> pixels -- converted time scale to x_scale, time function to scale.liner
          //var time_scale = d3.time.scale()
            //.range([margin, width])
            //.domain(time_extent);
		  var x_scale = d3.scale.linear()
			.range([margin, width])
			.domain(x_extent);

          // Create y-axis scale mapping HR -> pixels -- converted to bb
          var count_scale = d3.scale.linear()
            .range([height, margin])
            .domain(count_extent);

		  //Convert time to height
          var x_axis = d3.svg.axis()
            .scale(x_scale)
            //.ticks(d3.time.years, 2);  not sure what to do with this to get ticks// may need to change css code

          var count_axis = d3.svg.axis()
            .scale(count_scale)
            .orient("left");

          d3.select("svg")
            .append("g")
            .attr("class", "x axis")
            .attr("transform", "translate(0," + height + ")")
            .call(x_axis);

          d3.select("svg")
            .append("g")
            .attr("class", "y axis")
            .attr("transform", "translate(" + margin + ",0)")
            .call(count_axis);


		  //converted to bb changed time scale to count_x_scale & date to BMI
          d3.selectAll("circle")
            //.attr("cx", function(d) {
            //    return time_scale(d["date"]);
            //})
			.attr("cx", function(d) {
				return x_scale(d["BMI"]);
				}) 
            .attr("cy", function(d) {
                return count_scale(d["HR"]);
            })
            .attr("r", radius)
            //.attr("fill", color);
			//COLOR CIRCLES RED WHEN HR >250
			.attr('fill', function(d) {
				if (d['HR'] > 250){
					//circle {
					//	opacity: 1;
					//}
					return 'red';
				} else {
					return color;
				}
			});
        };

    </script>

<body>
  <script type="text/javascript">
  /*
    Use D3 (not dimple.js) to load the TSV file
    and pass the contents of it to the draw function
  */

  //example date: 27-05-1934 (16:00 h)
  //format = d3.time.format("%d-%m-%Y (%H:%M h)"); - removed time element
  
  //conversion complete -- remove later
  d3.csv("baseball_data_working.csv", function(d) {
      // transform data
	  //data = data.filter(function(d){
		//if(isNaN(d.ave)){
		//	return false;
		//}
		d['pheight'] = +d['height'];
		d['weight'] = +d['weight'];
		d['ave'] = +d['ave'];
		d['100ave'] = +d['ave']*100;
		d['HR'] = +d['HR'];
		d.bm = (+d.weight/(d.pheight*d.pheight))*703;
		d.BMI = d3.round(d.bm,1);
		//return true;
	  //});
      return d;  
  }, draw);
  </script>
